    }

        return ( 
            <div className="errorwall-container" style={errorStyle}>
                <div className="error-content-container">
                    <div className="error-name"><p>Błąd 503</p></div>
                    <div className="error-title"><p>Usługa niedostępna!</p></div>
                    <div className="error-info"><p>Serwer nie jest w stanie w danej chwili zrealizować zapytania o waluty. Spróbuj ponownie póżniej.</p></div>
                </div>
            </div>
        );
}
